    [],nt"revision_timestamp": "2016-07-15T04:24:05.640419",nt"name": "medicaid-analytic-extract-max-chartbooks-cc486",nt"isopen":
    true,nt"url": null,nt"notes": "<p>The Medicaid Analytic eXtract Chartbooks
    are research tools and reference guides on Medicaid enrollees and their Medicaid
    experience in 2002 and 2004. Developed for state Medicaid directors, policymakers,
    researchers, and others interested in the Medicaid program, the chartbooks consists
    of illustrative graphs, descriptive text, and an extensive data appendix with summary
    national- and state-level information on enrollee demographic and eligibility characteristics,
    Medicaid service use, and Medicaid expenditures in 2002 and 2004. The chartbooks
    summarize the Medicaid program and the MAX data system. They also present figures
    and tables that reflect the Medicaid population in 2002 and 2004. Chapter 2 profiles
    Medicaid enrollees and their Medicaid experience nationally, Chapter 3 presents
    state-level detail, and Chapters 4 through 6 provide supplementary information on
    special topic areas, including managed care, dual Medicare and Medicaid enrollees,
    and service use and expenditures by detailed type of service. An appendix contains
    source data tables for Chapters 3 through 6. The MAX Chartbooks, in PDF format,
    and their associated appendix tables, as zipped Excel files, can be downloaded.</p>n",nt"license_title":
